INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_videoCategory`, `field_client`, `field_projectName`, `field_email`, `field_address`, `field_fax`, `field_phone`, `field_monicaHindenBio`, `field_chrisMckennaBio`, `field_whatIsAWeeBeastie`, `field_aboutTheCompany`, `field_workType`, `field_videoCategories`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('1', '1', 'en_us', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2015-01-15 18:31:43', '2015-01-15 18:31:43', '12bd9827-430f-49f0-bade-6a3c1aee4b86');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_videoCategory`, `field_client`, `field_projectName`, `field_email`, `field_address`, `field_fax`, `field_phone`, `field_monicaHindenBio`, `field_chrisMckennaBio`, `field_whatIsAWeeBeastie`, `field_aboutTheCompany`, `field_workType`, `field_videoCategories`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('2', '2', 'en_us', 'Homepage', '<p>It’s true, this site doesn’t have a whole lot of content yet, but don’t worry. Our web developers have just installed the CMS, and they’re setting things up for the content editors this very moment. Soon Weebeastie.dev will be an oasis of fresh perspectives, sharp analyses, and astute opinions that will keep you coming back again and again.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2015-01-15 18:31:48', '2015-02-17 14:07:25', '94b1ad0a-28cd-4d69-87db-8024d6cd5d16');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_videoCategory`, `field_client`, `field_projectName`, `field_email`, `field_address`, `field_fax`, `field_phone`, `field_monicaHindenBio`, `field_chrisMckennaBio`, `field_whatIsAWeeBeastie`, `field_aboutTheCompany`, `field_workType`, `field_videoCategories`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('3', '3', 'en_us', 'We just installed Craft!', '<p>Craft is the CMS that’s powering Weebeastie.dev. It’s beautiful, powerful, flexible, and easy-to-use, and it’s made by Pixel &amp; Tonic. We can’t wait to dive in and see what it’s capable of!</p><!--pagebreak--><p>This is even more captivating content, which you couldn’t see on the News index page because it was entered after a Page Break, and the News index template only likes to show the content on the first page.</p><p>Craft: a nice alternative to Word, if you’re making a website.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2015-01-15 18:31:48', '2015-01-15 18:31:48', '914efef1-ec2a-4b3b-a62a-d79e199cf3b2');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_videoCategory`, `field_client`, `field_projectName`, `field_email`, `field_address`, `field_fax`, `field_phone`, `field_monicaHindenBio`, `field_chrisMckennaBio`, `field_whatIsAWeeBeastie`, `field_aboutTheCompany`, `field_workType`, `field_videoCategories`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('4', '4', 'en_us', NULL, NULL, NULL, NULL, NULL, 'info@weebeastie.tv', '116 Chambers Street Floor 5, New York, NY 10007', '866.317.9430', '212.349.0795', NULL, NULL, NULL, NULL, NULL, NULL, '2015-01-27 16:33:12', '2015-01-27 16:37:05', '55d579c5-648d-40f1-9bc8-58d2c5a8251a');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_videoCategory`, `field_client`, `field_projectName`, `field_email`, `field_address`, `field_fax`, `field_phone`, `field_monicaHindenBio`, `field_chrisMckennaBio`, `field_whatIsAWeeBeastie`, `field_aboutTheCompany`, `field_workType`, `field_videoCategories`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('5', '5', 'en_us', 'Our Work', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2015-01-27 16:56:56', '2015-04-02 12:33:34', '4c12f28d-51cd-4ed1-badf-bdc656d3728f');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_videoCategory`, `field_client`, `field_projectName`, `field_email`, `field_address`, `field_fax`, `field_phone`, `field_monicaHindenBio`, `field_chrisMckennaBio`, `field_whatIsAWeeBeastie`, `field_aboutTheCompany`, `field_workType`, `field_videoCategories`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('6', '6', 'en_us', 'Directors Page', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2015-01-27 17:00:43', '2015-03-26 01:49:22', '1add1806-488c-4f86-85cd-fca15008347b');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_videoCategory`, `field_client`, `field_projectName`, `field_email`, `field_address`, `field_fax`, `field_phone`, `field_monicaHindenBio`, `field_chrisMckennaBio`, `field_whatIsAWeeBeastie`, `field_aboutTheCompany`, `field_workType`, `field_videoCategories`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('7', '7', 'en_us', 'About', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p>is an experienced Executive Producer who has brought many high-end concepts from the printed page to the screen. Having produced Upfront projects for both Discovery Channel and The Learning Channel, she is an expert problem solver and no stranger to logistical nightmares. From Monica\'s point of view, nothing is a problem - there is always a solution. Relax, and let her handle it... </p>', '<p>has 20 years of experience as a writer and director of commercials, promos and short-form programming. His campaigns have led to higher ratings, brand recognition and ultimately profits for his clients. Chris has designed campaigns for household-name shows and commercial brands. As a director, Chris\'s strengths include directing show talent, compelling visuals and quirky comedy. </p>', '<p>Wee Beasties are those sticky concepts that get lodged inside your head. The catchy song that you keep humming, the stunning visual you can\'t forget, those great ideas that keep you from falling asleep. These clever concepts are our specialty, because Wee Beasties are what we\'re all about.</p>', '<p>\r\n	At Wee Beastie, we think up clever ideas and bring them to life. Our mission? Provide the most emotionally compelling advertising by focusing on initial creative development. For us, concept is king. The result? Work that always cuts through the clutter.\r\n</p>', NULL, NULL, '2015-01-27 17:06:00', '2015-01-27 23:25:45', 'e5012519-c763-4a25-9702-a6fd9a354c7d');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_videoCategory`, `field_client`, `field_projectName`, `field_email`, `field_address`, `field_fax`, `field_phone`, `field_monicaHindenBio`, `field_chrisMckennaBio`, `field_whatIsAWeeBeastie`, `field_aboutTheCompany`, `field_workType`, `field_videoCategories`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('8', '8', 'en_us', 'weebeastie-company-photo', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2015-01-27 22:53:24', '2015-03-31 12:25:11', 'cb87f107-238a-4ea3-a23c-c189ce0cc8c0');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_videoCategory`, `field_client`, `field_projectName`, `field_email`, `field_address`, `field_fax`, `field_phone`, `field_monicaHindenBio`, `field_chrisMckennaBio`, `field_whatIsAWeeBeastie`, `field_aboutTheCompany`, `field_workType`, `field_videoCategories`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('9', '9', 'en_us', 'Chris McKenna', '<p>Chris McKenna is the talent whisperer. He draws out a great performance in the most difficult of situations and puts high-flying actors and show hosts at ease. Chris is as an \"actor\'s director\" who also has a great eye for strong visuals and beautiful composition. Great with children and animals, he has survived the worst. Ask him about the homicidal pig. After the pig, he is ready for anything.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Comedy/Dialogue, Storytelling/Visual FX', NULL, '2015-01-28 14:03:09', '2015-01-28 14:08:09', '8b796316-d969-4d92-8383-bec95dc21ed7');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_videoCategory`, `field_client`, `field_projectName`, `field_email`, `field_address`, `field_fax`, `field_phone`, `field_monicaHindenBio`, `field_chrisMckennaBio`, `field_whatIsAWeeBeastie`, `field_aboutTheCompany`, `field_workType`, `field_videoCategories`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('10', '10', 'en_us', 'Lori Balaban', '<p>Lori Balaban has over a decade of entertainment industry experience. She\'s written, produced, and directed for NBC, AMC, CBS, National Geographic, Bain, Harley Davidson, Sundance, and Disney. She\'s committed to storytelling and has written numerous screenplays, documentaries and TV scripts. She\'s currently pursuing an MFA in Creative Writing.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Talent/Branded Entertainment', NULL, '2015-01-28 14:06:28', '2015-03-17 13:16:46', 'f196063c-91f2-49eb-b87c-a85c4aae131b');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_videoCategory`, `field_client`, `field_projectName`, `field_email`, `field_address`, `field_fax`, `field_phone`, `field_monicaHindenBio`, `field_chrisMckennaBio`, `field_whatIsAWeeBeastie`, `field_aboutTheCompany`, `field_workType`, `field_videoCategories`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('11', '11', 'en_us', 'Ronnie Krensel', '<p>Ronnie Krensel has been making commercials, promos, and TV shows for close to twenty years. In that time he\'s filmed with rockers, rappers, storm chasers, gurus and of course a few comedians. As one of the few show runners in the promo business, he understands how to boil the essence of a show down to just 30 seconds while still retaining the overall theme. On set, Ronnie is well versed in helping actors feel natural. Additionally, he helps non-actors find their inner performer, and brings out the best in cars, buildings, and other natural environments.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Real People/Automotive', NULL, '2015-01-28 14:09:05', '2015-01-28 14:09:05', '8e66eb2b-4be8-42ca-92f3-63e881dfb6c0');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_videoCategory`, `field_client`, `field_projectName`, `field_email`, `field_address`, `field_fax`, `field_phone`, `field_monicaHindenBio`, `field_chrisMckennaBio`, `field_whatIsAWeeBeastie`, `field_aboutTheCompany`, `field_workType`, `field_videoCategories`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('12', '12', 'en_us', 'JR Soldano', '<p>JR Soldano is a director, writer and producer who brings over 20 years of experience in both business-to-business and consumer channels. He spent 8 years with The Discovery Channel as their Supervising Producer and in-house director. JR has garnered a number of industry awards, including 6 Addys, a BDA Award, a Telly Award, 1 Silver and 3 Gold Promax award, and has directed two acclaimed, award-winning shorts in the past 4 years. In addition, JR is one of the creators/writers/producers of cult favorite Pancake Mountain—an offbeat, internet-based kids\' show—and also writes and performs as celebrity-interviewing puppet Rufus Leaking on the show.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Comedy/Drama/Network Talent', NULL, '2015-01-28 14:10:18', '2015-01-28 14:10:18', '880de079-90ab-40e6-bfa5-e1dab32030fd');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_videoCategory`, `field_client`, `field_projectName`, `field_email`, `field_address`, `field_fax`, `field_phone`, `field_monicaHindenBio`, `field_chrisMckennaBio`, `field_whatIsAWeeBeastie`, `field_aboutTheCompany`, `field_workType`, `field_videoCategories`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('13', '13', 'en_us', 'Alan William Harris', '<p>Alan William Harris is best known for his commercial work for a little mom-and-pop network called MTV, where he has received two Emmy nominations. Alan\'s visual sensibilities lean heavily on style and color while his comedic strengths highlight his background in improvised comedy (being an alumnus of The Second City and Upright Citizen\'s Brigade theaters). To date, he has directed such celebrity talent as Steve Carell, Paul Rudd, Chris Parnell, Rob Corddry and Justin Timerblake, with clients ranging from Burger King and Paramount Studios to Best Buy and The American Legacy Foundation. In addition to his commercial work, Alan is also in pre-production on his first feature film, an indie teen drama/comedy scheduled to shoot later this year.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Comedy Dialogue/Celebrity', NULL, '2015-01-28 14:11:27', '2015-03-17 13:07:48', '29fae377-9594-42f5-ac0c-16edbfcd2bbe');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_videoCategory`, `field_client`, `field_projectName`, `field_email`, `field_address`, `field_fax`, `field_phone`, `field_monicaHindenBio`, `field_chrisMckennaBio`, `field_whatIsAWeeBeastie`, `field_aboutTheCompany`, `field_workType`, `field_videoCategories`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('14', '14', 'en_us', 'The Perfect Choice', '<p>Create our very own game show, and have it hosted by the one and only Bob Eubanks? Count us in! This spot for DISH spices up the classic \"Dating Game\" format with new \"contestants\" and one very lucky lady. Everything about the spot is custom, from the custom-built 70\'s-themed set, to custom colors that mimic the iconic red hues of DISH. Bob Eubanks, the veteran game show host that he is, walked on set and was immediately in his element. The finished product is a riotous spot, and of course a happy couple.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2015-01-29 14:03:00', '2015-02-17 14:38:22', '9539c06d-2450-46f1-9080-de3d6b6075f3');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_videoCategory`, `field_client`, `field_projectName`, `field_email`, `field_address`, `field_fax`, `field_phone`, `field_monicaHindenBio`, `field_chrisMckennaBio`, `field_whatIsAWeeBeastie`, `field_aboutTheCompany`, `field_workType`, `field_videoCategories`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('15', '15', 'en_us', 'Chuck\'s Eat The Street', '<p>We put on our dancing shoes for the second season commercial shoot of<strong> Chuck\'s Eat The Street</strong> on <em>The Cooking Channel</em>. The spot was originally set as live action in the Bronx, but a massive thunderstorm the day of didn\'t agree with that plan. We reworked the concept to showcase Chuck\'s span across the country via green screen. Chuck and his loyal backup singers travel through postcards, visiting the streets of Washington DC, San Antonio, and more for the most delicious dishes. We\'re really happy with the spot in light of the initial challenges, and we thank Chuck and the crew for being so flexible. But now we can\'t get the spot\'s song out of our heads!</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2015-01-29 14:18:39', '2015-02-17 14:29:57', '28de595f-99c5-4498-9429-579e7c0f1945');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_videoCategory`, `field_client`, `field_projectName`, `field_email`, `field_address`, `field_fax`, `field_phone`, `field_monicaHindenBio`, `field_chrisMckennaBio`, `field_whatIsAWeeBeastie`, `field_aboutTheCompany`, `field_workType`, `field_videoCategories`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('16', '16', 'en_us', 'Coppertone', '<p>We start our celebration for the summer season early with <strong>Coppertone</strong> and <strong>USA Network</strong>. <strong>Mark Feuerstein</strong> reprises his role from USA\'s Royal Pains to enjoy a gorgeous day at the beach. He relaxes, wades in the water, and soaks up the sun with a bottle of Coopertone at hand. Always eager to show off, Mark makes sure to broadcast his fun to <strong>Callie Thorne</strong> of Necessary Roughness fame. Despite Mark\'s upbeat performance, this spot was actually filmed on one of the coldest days of the year! The spot was still a lot of fun to make, and a great way to connect summer fun for these two brands.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2015-01-30 14:12:55', '2015-02-17 14:37:50', 'd622da68-772a-4d20-8a81-4fef5b4220fc');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_videoCategory`, `field_client`, `field_projectName`, `field_email`, `field_address`, `field_fax`, `field_phone`, `field_monicaHindenBio`, `field_chrisMckennaBio`, `field_whatIsAWeeBeastie`, `field_aboutTheCompany`, `field_workType`, `field_videoCategories`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('17', '17', 'en_us', 'Life Is Funny', '<p>We had a great time shooting with TBS and Wendy\'s recently to create promos for the “Life is Funny\" campaign. After locating a fantastic apartment near Wee Beastie headquarters in downtown Manhattan, the crew loaded in for a long yet productive day of filming. The spots highlight the great things that happen when friends, and Wendy\'s, get together. When all was said and done, we had three brand new promos showcasing two fantastic brands. The team had lots of fun, but we are forever finished with the word “booyah\". Ha! Click the video link to check out the spot!</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2015-01-30 14:14:42', '2015-02-17 14:38:08', '2069908a-faaf-4f9e-8b90-368051036832');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_body`, `field_videoCategory`, `field_client`, `field_projectName`, `field_email`, `field_address`, `field_fax`, `field_phone`, `field_monicaHindenBio`, `field_chrisMckennaBio`, `field_whatIsAWeeBeastie`, `field_aboutTheCompany`, `field_workType`, `field_videoCategories`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('18', '18', 'en_us', 'The Walking Dead', NULL, 'Launch', 'DISH and AMC', 'The Walking Dead', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2015-02-06 14:20:40', '2015-02-13 14:40:01', 'eb7be747-c059-430b-982a-87fefe8456a3');
