INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('1', '2', '1', '1', 'en_us', '1', '', '{\"typeId\":\"1\",\"authorId\":null,\"title\":\"Homepage\",\"slug\":\"homepage\",\"postDate\":1421346707,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"15\":\"\"}}', '2015-01-27 16:59:19', '2015-01-27 16:59:19', 'c364f0e4-a0a2-4b62-9235-f6f68cf5836c');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('2', '7', '8', '1', 'en_us', '1', '', '{\"typeId\":\"9\",\"authorId\":null,\"title\":\"About\",\"slug\":\"about\",\"postDate\":1422378360,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"18\":\"\",\"16\":[\"8\"],\"17\":\"\",\"19\":\"\"}}', '2015-01-27 22:54:48', '2015-01-27 22:54:48', '3e3a04f9-9776-4c71-b0e1-05e0018e6dba');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('3', '7', '8', '1', 'en_us', '2', '', '{\"typeId\":\"9\",\"authorId\":null,\"title\":\"About\",\"slug\":\"about\",\"postDate\":1422378360,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"20\":\"<p>At Wee Beastie, we think up clever ideas and bring them to life. Our mission? Provide the most emotionally compelling advertising by focusing on initial creative development. For us, concept is king. The result? Work that always cuts through the clutter.<span><\\/span><\\/p>\",\"18\":\"\",\"16\":[\"8\"],\"17\":\"\",\"19\":\"\"}}', '2015-01-27 22:57:14', '2015-01-27 22:57:14', '3128d9cd-b505-42e8-912e-848afece6572');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('4', '7', '8', '1', 'en_us', '3', '', '{\"typeId\":\"9\",\"authorId\":null,\"title\":\"About\",\"slug\":\"about\",\"postDate\":1422378360,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"20\":\"<p>\\r\\n\\tAt Wee Beastie, we think up clever ideas and bring them to life. Our mission? Provide the most emotionally compelling advertising by focusing on initial creative development. For us, concept is king. The result? Work that always cuts through the clutter.\\r\\n<\\/p>\",\"18\":\"\",\"16\":[\"8\"],\"17\":\"\",\"19\":\"\"}}', '2015-01-27 23:02:21', '2015-01-27 23:02:21', 'a8a5f5f9-0a49-4beb-b0a0-15789fd71043');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('5', '7', '8', '1', 'en_us', '4', '', '{\"typeId\":\"9\",\"authorId\":null,\"title\":\"About\",\"slug\":\"about\",\"postDate\":1422378360,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"20\":\"<p>\\r\\n\\tAt Wee Beastie, we think up clever ideas and bring them to life. Our mission? Provide the most emotionally compelling advertising by focusing on initial creative development. For us, concept is king. The result? Work that always cuts through the clutter.\\r\\n<\\/p>\",\"18\":\"<p>has 20 years of experience as a writer and director of commercials, promos and short-form programming. His campaigns have led to higher ratings, brand recognition and ultimately profits for his clients. Chris has designed campaigns for household-name shows and commercial brands. As a director, Chris\'s strengths include directing show talent, compelling visuals and quirky comedy. <span><\\/span><\\/p>\",\"16\":[\"8\"],\"17\":\"<p>is an experienced Executive Producer who has brought many high-end concepts from the printed page to the screen. Having produced Upfront projects for both Discovery Channel and The Learning Channel, she is an expert problem solver and no stranger to logistical nightmares. From Monica\'s point of view, nothing is a problem - there is always a solution. Relax, and let her handle it... <span><\\/span><\\/p>\",\"19\":\"<p>Wee Beasties are those sticky concepts that get lodged inside your head. The catchy song that you keep humming, the stunning visual you can\'t forget, those great ideas that keep you from falling asleep. These clever concepts are our specialty, because Wee Beasties are what we\'re all about.<\\/p>\"}}', '2015-01-27 23:25:47', '2015-01-27 23:25:47', 'bbcf05d1-b435-499d-a369-b724cd607314');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('6', '9', '4', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Chris McKenna\",\"slug\":\"chris-mckenna\",\"postDate\":1422453788,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"1\":\"<p>Chris McKenna is the talent whisperer. He draws out a great performance in the most difficult of situations and puts high-flying actors and show hosts at ease. Chris is as an \\\"actor\'s director\\\" who also has a great eye for strong visuals and beautiful composition. Great with children and animals, he has survived the worst. Ask him about the homicidal pig. After the pig, he is ready for anything.<\\/p>\",\"15\":\"\"}}', '2015-01-28 14:03:10', '2015-01-28 14:03:10', 'f85536f6-0720-4f46-b41f-2866461c0aee');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('7', '10', '4', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Lori Balaban\",\"slug\":\"lori-balaban\",\"postDate\":1422453988,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"1\":\"<p><em>Talent\\/Branded Entertainment<\\/em><em><\\/em><br><\\/p><p>Lori Balaban has over a decade of entertainment industry experience. She\'s written, produced, and directed for NBC, AMC, CBS, National Geographic, Bain, Harley Davidson, Sundance, and Disney. She\'s committed to storytelling and has written numerous screenplays, documentaries and TV scripts. She\'s currently pursuing an MFA in Creative Writing.<\\/p>\",\"15\":\"\"}}', '2015-01-28 14:06:28', '2015-01-28 14:06:28', '666a4599-7483-4bb2-bbd2-54c2a038b6ad');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('8', '10', '4', '1', 'en_us', '2', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Lori Balaban\",\"slug\":\"lori-balaban\",\"postDate\":1422453960,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"1\":\"<p>Lori Balaban has over a decade of entertainment industry experience. She\'s written, produced, and directed for NBC, AMC, CBS, National Geographic, Bain, Harley Davidson, Sundance, and Disney. She\'s committed to storytelling and has written numerous screenplays, documentaries and TV scripts. She\'s currently pursuing an MFA in Creative Writing.<\\/p>\",\"15\":\"\",\"21\":\"Talent\\/Branded Entertainment\"}}', '2015-01-28 14:07:45', '2015-01-28 14:07:45', '4d291824-7126-4a95-8095-573ee89c49d0');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('9', '9', '4', '1', 'en_us', '2', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Chris McKenna\",\"slug\":\"chris-mckenna\",\"postDate\":1422453780,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"1\":\"<p>Chris McKenna is the talent whisperer. He draws out a great performance in the most difficult of situations and puts high-flying actors and show hosts at ease. Chris is as an \\\"actor\'s director\\\" who also has a great eye for strong visuals and beautiful composition. Great with children and animals, he has survived the worst. Ask him about the homicidal pig. After the pig, he is ready for anything.<\\/p>\",\"15\":\"\",\"21\":\"Comedy\\/Dialogue, Storytelling\\/Visual FX\"}}', '2015-01-28 14:08:09', '2015-01-28 14:08:09', '41d43e28-5ee2-4627-86c6-61692a29790f');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('10', '11', '4', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Ronnie Krensel\",\"slug\":\"ronnie-krensel\",\"postDate\":1422454145,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"1\":\"<p>Ronnie Krensel has been making commercials, promos, and TV shows for close to twenty years. In that time he\'s filmed with rockers, rappers, storm chasers, gurus and of course a few comedians. As one of the few show runners in the promo business, he understands how to boil the essence of a show down to just 30 seconds while still retaining the overall theme. On set, Ronnie is well versed in helping actors feel natural. Additionally, he helps non-actors find their inner performer, and brings out the best in cars, buildings, and other natural environments.<\\/p>\",\"15\":\"\",\"21\":\"Real People\\/Automotive\"}}', '2015-01-28 14:09:06', '2015-01-28 14:09:06', '1828114a-d907-49e9-9201-d31f2deb1b7b');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('11', '12', '4', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"JR Soldano\",\"slug\":\"jr-soldano\",\"postDate\":1422454218,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"1\":\"<p>JR Soldano is a director, writer and producer who brings over 20 years of experience in both business-to-business and consumer channels. He spent 8 years with The Discovery Channel as their Supervising Producer and in-house director. JR has garnered a number of industry awards, including 6 Addys, a BDA Award, a Telly Award, 1 Silver and 3 Gold Promax award, and has directed two acclaimed, award-winning shorts in the past 4 years. In addition, JR is one of the creators\\/writers\\/producers of cult favorite Pancake Mountain\\u2014an offbeat, internet-based kids\' show\\u2014and also writes and performs as celebrity-interviewing puppet Rufus Leaking on the show.<\\/p>\",\"15\":\"\",\"21\":\"Comedy\\/Drama\\/Network Talent\"}}', '2015-01-28 14:10:18', '2015-01-28 14:10:18', '215fe021-4aad-480a-8fc1-7392650e5f4a');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('12', '13', '4', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Alan William Harris\",\"slug\":\"alan-william-harris\",\"postDate\":1422454287,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"1\":\"<p>Alan William Harris is best known for his commercial work for a little mom-and-pop network called MTV, where he has received two Emmy nominations. Alan\'s visual sensibilities lean heavily on style and color while his comedic strengths highlight his background in improvised comedy (being an alumnus of The Second City and Upright Citizen\'s Brigade theaters). To date, he has directed such celebrity talent as Steve Carell, Paul Rudd, Chris Parnell, Rob Corddry and Justin Timerblake, with clients ranging from Burger King and Paramount Studios to Best Buy and The American Legacy Foundation. In addition to his commercial work, Alan is also in pre-production on his first feature film, an indie teen drama\\/comedy scheduled to shoot later this year.<\\/p>\",\"15\":\"\",\"21\":\"Comedy Dialogue\\/Celebrity\"}}', '2015-01-28 14:11:27', '2015-01-28 14:11:27', '108faeef-8f04-4b5c-946c-fecc58343f0b');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('13', '14', '2', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"The Perfect Choice\",\"slug\":\"the-perfect-choice\",\"postDate\":1395964800,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"1\":\"<p>Create our very own game show, and have it hosted by the one and only Bob Eubanks? Count us in! This spot for DISH spices up the classic \\\"Dating Game\\\" format with new \\\"contestants\\\" and one very lucky lady. Everything about the spot is custom, from the custom-built 70\'s-themed set, to custom colors that mimic the iconic red hues of DISH. Bob Eubanks, the veteran game show host that he is, walked on set and was immediately in his element. The finished product is a riotous spot, and of course a happy couple.<span><\\/span><\\/p>\",\"14\":\"\"}}', '2015-01-29 14:03:01', '2015-01-29 14:03:01', '19dd77b5-58ac-4ce7-98c5-5a6ef86b7e6a');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('14', '15', '2', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Chuck\'s Eat The Street\",\"slug\":\"chucks-eat-the-street\",\"postDate\":1374710400,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"1\":\"<p>We put on our dancing shoes for the second season commercial shoot of<strong> Chuck\'s Eat The Street<\\/strong> on <em>The Cooking Channel<\\/em>. The spot was originally set as live action in the Bronx, but a massive thunderstorm the day of didn\'t agree with that plan. We reworked the concept to showcase Chuck\'s span across the country via green screen. Chuck and his loyal backup singers travel through postcards, visiting the streets of Washington DC, San Antonio, and more for the most delicious dishes. We\'re really happy with the spot in light of the initial challenges, and we thank Chuck and the crew for being so flexible. But now we can\'t get the spot\'s song out of our heads!<\\/p>\",\"14\":\"\"}}', '2015-01-29 14:18:39', '2015-01-29 14:18:39', '1e8acba0-b319-495e-8575-db80ef4b7a96');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('15', '16', '2', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Coppertone\",\"slug\":\"coppertone\",\"postDate\":1369267200,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"1\":\"<p>We start our celebration for the summer season early with <strong>Coppertone<\\/strong> and <strong>USA Network<\\/strong>. <strong>Mark Feuerstein<\\/strong> reprises his role from USA\'s Royal Pains to enjoy a gorgeous day at the beach. He relaxes, wades in the water, and soaks up the sun with a bottle of Coopertone at hand. Always eager to show off, Mark makes sure to broadcast his fun to <strong>Callie Thorne<\\/strong> of Necessary Roughness fame. Despite Mark\'s upbeat performance, this spot was actually filmed on one of the coldest days of the year! The spot was still a lot of fun to make, and a great way to connect summer fun for these two brands.<\\/p>\",\"14\":\"\"}}', '2015-01-30 14:12:56', '2015-01-30 14:12:56', 'e3ad9156-c6e1-42c1-906a-afd3b738e645');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('16', '17', '2', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Life Is Funny\",\"slug\":\"life-is-funny\",\"postDate\":1422627282,\"expiryDate\":1369094400,\"enabled\":1,\"fields\":{\"1\":\"We had a great time shooting with TBS and Wendy\\u2019s recently to create promos for the \\u201cLife is Funny\\u201d campaign. After locating a fantastic apartment near Wee Beastie headquarters in downtown Manhattan, the crew loaded in for a long yet productive day of filming. The spots highlight the great things that happen when friends, and Wendy\\u2019s, get together. When all was said and done, we had three brand new promos showcasing two fantastic brands. The team had lots of fun, but we are forever finished with the word \\u201cbooyah\\u201d. Ha! Click the video link to check out the spot!\",\"14\":\"\"}}', '2015-01-30 14:14:42', '2015-01-30 14:14:42', '28203a67-3f59-42d6-9f22-a487b7454cf5');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('17', '17', '2', '1', 'en_us', '2', '', '{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Life Is Funny\",\"slug\":\"life-is-funny\",\"postDate\":1369145640,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"1\":\"<p>We had a great time shooting with TBS and Wendy\'s recently to create promos for the \\u201cLife is Funny\\\" campaign. After locating a fantastic apartment near Wee Beastie headquarters in downtown Manhattan, the crew loaded in for a long yet productive day of filming. The spots highlight the great things that happen when friends, and Wendy\'s, get together. When all was said and done, we had three brand new promos showcasing two fantastic brands. The team had lots of fun, but we are forever finished with the word \\u201cbooyah\\\". Ha! Click the video link to check out the spot!<\\/p>\",\"14\":\"\"}}', '2015-01-30 14:15:20', '2015-01-30 14:15:20', '050b5ca8-3586-4707-932e-d8bd1661f544');
