INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('34', '15', '2', '1', 'en_us', '2', '', '{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Chuck\'s Eat The Street\",\"slug\":\"chucks-eat-the-street\",\"postDate\":1374710400,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"1\":\"<p>We put on our dancing shoes for the second season commercial shoot of<strong> Chuck\'s Eat The Street<\\/strong> on <em>The Cooking Channel<\\/em>. The spot was originally set as live action in the Bronx, but a massive thunderstorm the day of didn\'t agree with that plan. We reworked the concept to showcase Chuck\'s span across the country via green screen. Chuck and his loyal backup singers travel through postcards, visiting the streets of Washington DC, San Antonio, and more for the most delicious dishes. We\'re really happy with the spot in light of the initial challenges, and we thank Chuck and the crew for being so flexible. But now we can\'t get the spot\'s song out of our heads!<\\/p>\",\"14\":[\"35\"]}}', '2015-02-17 14:29:58', '2015-02-17 14:29:58', 'bd025839-d07a-441c-a5e1-5c70dcbefe03');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('35', '16', '2', '1', 'en_us', '2', '', '{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Coppertone\",\"slug\":\"coppertone\",\"postDate\":1369267200,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"1\":\"<p>We start our celebration for the summer season early with <strong>Coppertone<\\/strong> and <strong>USA Network<\\/strong>. <strong>Mark Feuerstein<\\/strong> reprises his role from USA\'s Royal Pains to enjoy a gorgeous day at the beach. He relaxes, wades in the water, and soaks up the sun with a bottle of Coopertone at hand. Always eager to show off, Mark makes sure to broadcast his fun to <strong>Callie Thorne<\\/strong> of Necessary Roughness fame. Despite Mark\'s upbeat performance, this spot was actually filmed on one of the coldest days of the year! The spot was still a lot of fun to make, and a great way to connect summer fun for these two brands.<\\/p>\",\"14\":[\"33\"]}}', '2015-02-17 14:37:50', '2015-02-17 14:37:50', 'c33558f5-732a-434f-a8d1-bc929112895a');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('36', '17', '2', '1', 'en_us', '3', '', '{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"Life Is Funny\",\"slug\":\"life-is-funny\",\"postDate\":1369145640,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"1\":\"<p>We had a great time shooting with TBS and Wendy\'s recently to create promos for the \\u201cLife is Funny\\\" campaign. After locating a fantastic apartment near Wee Beastie headquarters in downtown Manhattan, the crew loaded in for a long yet productive day of filming. The spots highlight the great things that happen when friends, and Wendy\'s, get together. When all was said and done, we had three brand new promos showcasing two fantastic brands. The team had lots of fun, but we are forever finished with the word \\u201cbooyah\\\". Ha! Click the video link to check out the spot!<\\/p>\",\"14\":[\"37\"]}}', '2015-02-17 14:38:08', '2015-02-17 14:38:08', 'd354ff1b-be99-40da-b900-ae3e1f56fdae');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('37', '14', '2', '1', 'en_us', '2', '', '{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"The Perfect Choice\",\"slug\":\"the-perfect-choice\",\"postDate\":1395964800,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"1\":\"<p>Create our very own game show, and have it hosted by the one and only Bob Eubanks? Count us in! This spot for DISH spices up the classic \\\"Dating Game\\\" format with new \\\"contestants\\\" and one very lucky lady. Everything about the spot is custom, from the custom-built 70\'s-themed set, to custom colors that mimic the iconic red hues of DISH. Bob Eubanks, the veteran game show host that he is, walked on set and was immediately in his element. The finished product is a riotous spot, and of course a happy couple.<\\/p>\",\"14\":[\"39\"]}}', '2015-02-17 14:38:22', '2015-02-17 14:38:22', '03137ff2-bd84-4ce8-83b8-c37fdef41d0a');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('38', '37', '3', '1', 'en_us', '4', '', '{\"typeId\":\"3\",\"authorId\":\"1\",\"title\":\"A&E Wendy\'s Shipping Wars\",\"slug\":\"a-e-wendys-shipping-wars\",\"postDate\":1423575900,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"1\":\"\",\"8\":\"A&E and Wendy\'s\",\"7\":[\"9\"],\"3\":[\"22\"],\"4\":[\"26\"],\"9\":\"Shipping Wars\",\"5\":[\"36\"],\"6\":\"Automotive\"}}', '2015-03-05 22:00:41', '2015-03-05 22:00:41', '330e5cf5-d938-48dd-9835-e074a2249527');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('39', '43', '3', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Test From Denizen\",\"slug\":\"test-from-denizen\",\"postDate\":1426252869,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"1\":\"\",\"8\":\"Company\",\"7\":[\"10\"],\"3\":[\"40\"],\"4\":[\"41\"],\"9\":\"Placeholder Project Name\",\"5\":[\"42\"],\"6\":\"Co-Branded\"}}', '2015-03-13 13:21:09', '2015-03-13 13:21:09', '1d191d1e-984f-4dbc-962d-8e673947da05');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('40', '6', '7', '1', 'en_us', '1', '', '{\"typeId\":\"8\",\"authorId\":null,\"title\":\"Directors Page\",\"slug\":\"directorspage\",\"postDate\":1422378043,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"7\":[\"13\",\"12\",\"10\",\"11\"]}}', '2015-03-17 13:04:14', '2015-03-17 13:04:14', 'a8084773-6990-4535-a3cf-ce8f41c624da');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('41', '13', '4', '1', 'en_us', '2', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Alan William Harris\",\"slug\":\"alan-william-harris\",\"postDate\":1422454260,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"1\":\"<p>Alan William Harris is best known for his commercial work for a little mom-and-pop network called MTV, where he has received two Emmy nominations. Alan\'s visual sensibilities lean heavily on style and color while his comedic strengths highlight his background in improvised comedy (being an alumnus of The Second City and Upright Citizen\'s Brigade theaters). To date, he has directed such celebrity talent as Steve Carell, Paul Rudd, Chris Parnell, Rob Corddry and Justin Timerblake, with clients ranging from Burger King and Paramount Studios to Best Buy and The American Legacy Foundation. In addition to his commercial work, Alan is also in pre-production on his first feature film, an indie teen drama\\/comedy scheduled to shoot later this year.<\\/p>\",\"15\":[\"39\",\"43\",\"18\"],\"21\":\"Comedy Dialogue\\/Celebrity\"}}', '2015-03-17 13:07:49', '2015-03-17 13:07:49', 'd42e9279-2d80-4e6d-b5e7-c3c631446ddf');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `num`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('42', '10', '4', '1', 'en_us', '3', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Lori Balaban\",\"slug\":\"lori-balaban\",\"postDate\":1422453960,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"1\":\"<p>Lori Balaban has over a decade of entertainment industry experience. She\'s written, produced, and directed for NBC, AMC, CBS, National Geographic, Bain, Harley Davidson, Sundance, and Disney. She\'s committed to storytelling and has written numerous screenplays, documentaries and TV scripts. She\'s currently pursuing an MFA in Creative Writing.<\\/p>\",\"15\":[\"37\"],\"21\":\"Talent\\/Branded Entertainment\"}}', '2015-03-17 13:16:46', '2015-03-17 13:16:46', 'fd7a70ea-b7ac-4225-b149-7b4ee068a54a');
