INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('7', 'field', '17', 'en_us', ' is an experienced executive producer who has brought many high end concepts from the printed page to the screen having produced upfront projects for both discovery channel and the learning channel she is an expert problem solver and no stranger to logistical nightmares from monica s point of view nothing is a problem there is always a solution relax and let her handle it ');
INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('7', 'field', '18', 'en_us', ' has 20 years of experience as a writer and director of commercials promos and short form programming his campaigns have led to higher ratings brand recognition and ultimately profits for his clients chris has designed campaigns for household name shows and commercial brands as a director chris s strengths include directing show talent compelling visuals and quirky comedy ');
