INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('11', 'field', '1', 'en_us', ' ronnie krensel has been making commercials promos and tv shows for close to twenty years in that time he s filmed with rockers rappers storm chasers gurus and of course a few comedians as one of the few show runners in the promo business he understands how to boil the essence of a show down to just 30 seconds while still retaining the overall theme on set ronnie is well versed in helping actors feel natural additionally he helps non actors find their inner performer and brings out the best in cars buildings and other natural environments ');
