INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('12', 'field', '1', 'en_us', ' jr soldano is a director writer and producer who brings over 20 years of experience in both business to business and consumer channels he spent 8 years with the discovery channel as their supervising producer and in house director jr has garnered a number of industry awards including 6 addys a bda award a telly award 1 silver and 3 gold promax award and has directed two acclaimed award winning shorts in the past 4 years in addition jr is one of the creators writers producers of cult favorite pancake mountain an offbeat internet based kids show and also writes and performs as celebrity interviewing puppet rufus leaking on the show ');
