INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('13', 'field', '1', 'en_us', ' alan william harris is best known for his commercial work for a little mom and pop network called mtv where he has received two emmy nominations alan s visual sensibilities lean heavily on style and color while his comedic strengths highlight his background in improvised comedy being an alumnus of the second city and upright citizen s brigade theaters to date he has directed such celebrity talent as steve carell paul rudd chris parnell rob corddry and justin timerblake with clients ranging from burger king and paramount studios to best buy and the american legacy foundation in addition to his commercial work alan is also in pre production on his first feature film an indie teen drama comedy scheduled to shoot later this year ');
