INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('14', 'field', '1', 'en_us', ' create our very own game show and have it hosted by the one and only bob eubanks count us in this spot for dish spices up the classic dating game format with new contestants and one very lucky lady everything about the spot is custom from the custom built 70 s themed set to custom colors that mimic the iconic red hues of dish bob eubanks the veteran game show host that he is walked on set and was immediately in his element the finished product is a riotous spot and of course a happy couple ');
