INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('15', 'field', '1', 'en_us', ' we put on our dancing shoes for the second season commercial shoot of chuck s eat the street on the cooking channel the spot was originally set as live action in the bronx but a massive thunderstorm the day of didn t agree with that plan we reworked the concept to showcase chuck s span across the country via green screen chuck and his loyal backup singers travel through postcards visiting the streets of washington dc san antonio and more for the most delicious dishes we re really happy with the spot in light of the initial challenges and we thank chuck and the crew for being so flexible but now we can t get the spot s song out of our heads ');
