INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('16', 'field', '1', 'en_us', ' we start our celebration for the summer season early with coppertone and usa network mark feuerstein reprises his role from usa s royal pains to enjoy a gorgeous day at the beach he relaxes wades in the water and soaks up the sun with a bottle of coopertone at hand always eager to show off mark makes sure to broadcast his fun to callie thorne of necessary roughness fame despite mark s upbeat performance this spot was actually filmed on one of the coldest days of the year the spot was still a lot of fun to make and a great way to connect summer fun for these two brands ');
